    public void populateCsApiBan(CsApiBanInput csApiBanInput) throws FMLManipulationException {

        // Special mapping (ie copy between not same-named fields) from this buffer to CsApiBan input.
        // TODO: How do we know which fields to map to which others?
        if (csApiBanInput.get_PCTNAGRPRMRECBAN() == null) {
            csApiBanInput.set_PCTNAGRPRMRECBAN(this.get_BAN());
        }
        if (csApiBanInput.get_PCTNAGRPRMRECCUSTOMER_ID() == null) {
            csApiBanInput.set_PCTNAGRPRMRECCUSTOMER_ID(this.get_CUSTOMER_ID());
        }
        if (csApiBanInput.get_PNAMEADRBUFROWCOUNT() == null) {
            csApiBanInput.set_PNAMEADRBUFROWCOUNT(this.get_ROWCOUNT());
        }
        for (int i = 0; i < this.get_EFFECTIVE_DATE_size(); i++) {
            csApiBanInput.set_LNKRECEFFECTIVE_DATE(i, this.get_EFFECTIVE_DATE(i));
        }
        for (int i = 0; i < this.get_ROWID_size(); i++) {
            csApiBanInput.set_NAMERECROWID(i, this.get_ROWID(i));
        }
        for (int i = 0; i < this.get_SYS_CREATION_DATE_size(); i++) {
            csApiBanInput.set_NAMERECSYS_CREATION_DATE(i, this.get_SYS_CREATION_DATE(i));
        }
        for (int i = 0; i < this.get_SYS_UPDATE_DATE_size(); i++) {
            csApiBanInput.set_NAMERECSYS_UPDATE_DATE(i, this.get_SYS_UPDATE_DATE(i));
        }
        for (int i = 0; i < this.get_DL_SERVICE_CODE_size(); i++) {
            csApiBanInput.set_NAMERECDL_SERVICE_CODE(i, this.get_DL_SERVICE_CODE(i));
        }
        for (int i = 0; i < this.get_DL_UPDATE_STAMP_size(); i++) {
            csApiBanInput.set_NAMERECDL_UPDATE_STAMP(i, this.get_DL_UPDATE_STAMP(i));
        }
        for (int i = 0; i < this.get_CONV_RUN_NO_size(); i++) {
            csApiBanInput.set_NAMERECCONV_RUN_NO(i, this.get_CONV_RUN_NO(i));
        }

        // General mapping (ie copy between same-named fields) from this buffer to CsApiBan input.
        ServiceParameter.copyFmlBuffer(this, csApiBanInput, fieldsNotToBeDirectlyCopied);
    }
